import React, {Component} from 'react';
import { makeStyles,withStyles,lighten } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardHeader from '@material-ui/core/CardHeader';
import CardContent from '@material-ui/core/CardContent';
import CardActions from '@material-ui/core/CardActions';
import Avatar from '@material-ui/core/Avatar';
import IconButton from '@material-ui/core/IconButton';
import Typography from '@material-ui/core/Typography';
import { grey } from '@material-ui/core/colors';
import LongMenu from './Menu/menu';
import LinearProgress from "@material-ui/core/LinearProgress";

const useStyles = makeStyles(theme => ({
    card: {
        maxWidth: 345,
    },
    media: {
        height: 0,
        paddingTop: '56.25%', // 16:9
    },
    expand: {
        transform: 'rotate(0deg)',
        marginLeft: 'auto',
        transition: theme.transitions.create('transform', {
            duration: theme.transitions.duration.shortest,
        }),
    },
    expandOpen: {
        transform: 'rotate(180deg)',
    },
    avatar: {
        backgroundColor: grey[500],
    },
    root: {
        flexGrow: 1,
    },
    margin: {
        margin: theme.spacing(1),
    },
}));

const BorderLinearProgress = withStyles({
    root: {
        height: 7,
        backgroundColor: lighten('#ff23d6', 0.5),
        borderRadius: 20,
    },
    bar: {
        borderRadius: 20,
        backgroundColor: '#ff23d6',
    },
})(LinearProgress);

function Material_Card() {
    const classes = useStyles();
    const hello = 'Zone 1';
    return (
        <Card className={classes.card}>
            <CardHeader
                avatar={
                    <Avatar aria-label="Recipe" className={classes.avatar}>
                        1
                    </Avatar>
                }
                action={
                    <IconButton aria-label="Settings">
                        <LongMenu/>
                    </IconButton>
                }
                title={hello}
                subheader="2019-06-26"
            />
            <CardContent>
                <Typography variant="h6" color="textPrimary" component="p">
                    Total Rows : 280
                </Typography>
                <Typography variant="body2" color="textSecondary" component="p">
                DC Cap: 3.04 MW
            </Typography>
                <Typography variant="body2" color="textSecondary" component="p">
                    AC Cap: 2.76 MW
                </Typography>
            </CardContent>
            <CardActions>

            </CardActions>
            <CardActions disableSpacing>
                <Typography variant='h6' color='textSecondary'>70% Completed</Typography>

            </CardActions><div>
            <BorderLinearProgress
                className={classes.margin}
                variant="determinate"
                value={70}
            />
        </div>
            {/*<Collapse in={expanded} timeout="auto" unmountOnExit>*/}
            {/*    <CardContent>*/}
            {/*        /!*<Typography paragraph>Method:</Typography>*!/*/}
            {/*        /!*<Typography paragraph>*!/*/}
            {/*        /!*    Heat 1/2 cup of the broth in a pot until simmering, add saffron and set aside for 10*!/*/}
            {/*        /!*    minutes.*!/*/}
            {/*        /!*</Typography>*!/*/}
            {/*        /!*<Typography paragraph>*!/*/}
            {/*        /!*    Heat oil in a (14- to 16-inch) paella pan or a large, deep skillet over medium-high*!/*/}
            {/*        /!*    heat. Add chicken, shrimp and chorizo, and cook, stirring occasionally until lightly*!/*/}
            {/*        /!*    browned, 6 to 8 minutes. Transfer shrimp to a large plate and set aside, leaving chicken*!/*/}
            {/*        /!*    and chorizo in the pan. Add pimentón, bay leaves, garlic, tomatoes, onion, salt and*!/*/}
            {/*        /!*    pepper, and cook, stirring often until thickened and fragrant, about 10 minutes. Add*!/*/}
            {/*        /!*    saffron broth and remaining 4 1/2 cups chicken broth; bring to a boil.*!/*/}
            {/*        /!*</Typography>*!/*/}
            {/*        /!*<Typography paragraph>*!/*/}
            {/*        /!*    Add rice and stir very gently to distribute. Top with artichokes and peppers, and cook*!/*/}
            {/*        /!*    without stirring, until most of the liquid is absorbed, 15 to 18 minutes. Reduce heat to*!/*/}
            {/*        /!*    medium-low, add reserved shrimp and mussels, tucking them down into the rice, and cook*!/*/}
            {/*        /!*    again without stirring, until mussels have opened and rice is just tender, 5 to 7*!/*/}
            {/*        /!*    minutes more. (Discard any mussels that don’t open.)*!/*/}
            {/*        /!*</Typography>*!/*/}
            {/*        /!*<Typography>*!/*/}
            {/*        /!*    Set aside off of the heat to let rest for 10 minutes, and then serve.*!/*/}
            {/*        /!*</Typography>*!/*/}
            {/*    </CardContent>*/}
            {/*</Collapse>*/}
        </Card>
    );
}
export default withStyles()(Material_Card);


